from typing import List, Optional

def entance(numbers: List[int], delimiter: int) -> Optional[List[int]]:
    """"""
    if not all((numbers[i] < numbers[i + 1] for i in range(len(numbers) - 1))):
        return None
    result = []
    for num in numbers:
        result.append(num)
        result.append(delimiter)
    if result:
        result.pop()
    return result
